text:
During today's press conference we stopped for cake for Markus Rehm's birthday.

Rehm is aiming to break his own world record (8.62m) in the T64 long jump at #Tokyo2020. Will there be more celebrations for Markus? 

@ParaAthletics @teamdpara @TeamD https://t.co/3oiLN7Ib2o

